import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div>
      {States()}
      {Grid()}
      {Achievements()}
    </div>
  );
}

function States() {
  return (
    <div class="States">
      <p>California</p>
      <p>Texas</p>
    </div>
  );
}

function Grid() {
  return (
    <div class="Grid">
      <p>1</p>
      <p>2</p>
    </div>
  );
}

function Achievements() {
  return (
    <div class="Grid">
      <p>first</p>
      <p>second</p>
    </div>
  );
}

export default App;
